  false,\n\t\"url\": null,\n\t\"notes\": \"Data represents National Nanotechnology
  Initiative investments by agency and program component area (PCA) from FY 2001 through
  FY 2010 (requested). While this data has been available as part of the NNI's annual
  supplements to the President's Budget, the funding data presented here is more accessible
  and readily available for analysis by users to assess trends and examine investment
  allocations over the 10-year history of the NNI. The cumulative NNI investment of
  nearly $12 billion in nanotechnology research and development continues to advance
  our understanding of the unique phenomena and processes that occur at the nanoscale
  and to leverage that knowledge to speed innovation in high-impact opportunity areas
  such as energy, security, and medicine.\",\n\t\"license_title\": null,\n\t\"extras\":
